description:
The City of Napoli joined the second edition of the project Peace Civil Corps in Kosovo, proposed by the OnG Operatori di Pace ONLUS, with the aim to build a partnership between the two Neapolitan promoters (Operatori di pace, leader, and IPRI rete CCP, partner) and some Kosovan organizations with the aim to solve social and cultural conflicts and to create options of positive peace; The project has developed actions of consolidation of the strategy, methodology and application of mixed Civil Peace Corps (Italian and Kosovan) and action of comparison with similar experiences that took place directly in the countries ravaged by war; actions of networking and organization of best practices and lessons learned trough the experience gained by the implementation of the project "Civil Peace Corps in Kosovo" (website, manuals and  applications; video; communication channels for the operators, blogs);
feedback in the territory of the City of Naples and Kosovo of the developed practices through an action of comparison that may lead in the future to the realization of self-sustainable implementations (series of conferences and seminars, a manual of best practises, realization of a computerised press office).

--

The programme will concentrate on:
 Strengthening the existing network of co-operations among Indian and European HEIs;
 Expanding the Indian HEIs experience in student and staff exchanges, good practices regarding academic harmonisation, mutual recognition with European HEIs, organisation and management of mobility in accordance with the Bologna Process / Credit transfer.
